CREATE TRIGGER `verificaCreditiStudente`
BEFORE INSERT ON `sostenimento` FOR EACH ROW --prima dell'inserimento di una nuova riga viene effetutato il controllo pevisto nel TRIGGER
BEGIN
DECLARE numero_crediti_studente INT DEFAULT 0;
-- equivale in Java ad: int numeroCreditiStudente = 0
-- numero di crediti per lo studente specifico di cui si sta inserendo la registreazione del voto
-- il cursore rappresenta una variabile tabella in memoria RAM:
-- ogni qualvolta si esegue un comando SQL-SELECT i risultati vengono memorizzati-- e danno vita ad una nuova tabella con nome del campo e relativo valore-- In MYSQL per fare riferimento ai risultati di una query si usa il tipo CURSOR.-- Di seguito la dichiarazione della variabile di tipo CURSOR ' -- cursore_crediti_studente' e sua valorizzazione col relativo comando SQL-SELECT
DECLARE cursore_crediti_studente CURSOR FOR
SELECT SUM(es.numero_crediti) as numero_crediti FROM sostenimento so inner join esame es on so.codice_esame = es.codice_esameWHERE so.matricola = new.matricola -- preleva il valore matricola del nuovo record che si sta inserendo GROUP BY so.matricola;
-- Esecuzione della query di SELECT (comando OPEN) con popolamento dei risultati (un solo record risultante con un solo campo 'numero_crediti')-- usato per valorizzare la variabile 'cursore_crediti_studente' (comando FETCH).-- Infine, il risutlato del cursore viene rimosso (comando CLOSE) per liberare memoria RAM.
OPEN cursore_crediti_studente;
FETCH cursore_crediti_studente into numero_crediti_studente;
CLOSE cursore_crediti_studente;
-- Verifica che il numero di crediti non sia superiore al valore 10. In caso contrario la procedura esegue un comando SIGNAL-- con un messaggio testo che segnala l'avvenuto raggiugnimento del massimo numero di crediti, impedendo quindi l'inserimento del record di sostenimento.
IF (numero_crediti_studente > 10) THEN
SIGNAL SQLSTATE '75000' SET MESSAGE_TEXT="sostenimento dell'esame non registrabile, lo studente ha gi un numero di crediti sufficiente per laurearsi!!!";
END IF;
END
